import  { FC } from 'React';
import styled from 'styled-components';




const ExpandedMenuContet = styled.div`
`;

const MenuItem = styled.div`
`;
const MediaIcon = styled.img`
margin-left:10px;
`;


export const ExpandedMenu: FC = () => {
    return(
     
            <ExpandedMenuContet>
                <MenuItem>
                <MediaIcon src="./media/icons/house.png"  alt="" />
                Home
                </MenuItem>
                <MenuItem>
                <img src="./media/icons/Publications.png"  alt="" />
                Publications
                </MenuItem>
                <MenuItem>
                <img src="./media/icons/people.png"  alt="" />
                People
                </MenuItem>
                <MenuItem>
                <img src="./media/icons/entities.png"  alt="" />
                Entities
                </MenuItem>
                <MenuItem>
                <img src="./media/icons/administration.png"  alt="" />
                Administration
                </MenuItem>
            </ExpandedMenuContet>
      
    );
};
